import Link from 'next/link'

const linkStyle = {
  marginRight: 15
}
const services_array = ["Solutions", "Projects", "Gear", "Music"];
export default function Header() {
  return (

    <nav className="navbar navbar-dark fixed-top navbar-expand-lg toggle-height" id="global-nav">
    <script type="text/javascript" src="/scripts/nav.js"></script>

        <div className="container">
      <Link href="/">
        <a className="navbar-brand scrollN">Prabhakar Mishra</a>
      </Link>
      <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span class="navbar-toggler-icon custom-toggler"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarSupportedContent">
        <ul class="navbar-nav mr-auto">
          {services_array.map(service => (
            <li>
              <Link href={`/${service}`}>
                  <a className="nav-link scrollN font">{service}</a>
              </Link>
            </li>
          ))}
        </ul>
        <ul class="navbar-nav">
          <li>
            <Link href="/Contact">
              <a class="nav-link scrollN">Contact</a>
            </Link>
          </li>
        </ul>
      </div>
        </div>
        <style jsx>{`a {
          font-family : "Gravity-Book";
          font-weight : magenta;
      }`}</style>
    </nav>
  )
}
